printprops({x:1});
var total = distance(0,0,2,1) + distance(2,1,3,5);
var probability = factorial(5)/factorial(13);
Em uma chamada, cada expressão de argumento (aquelas entre os parênteses) é avaliada e os valores 
resultantes se tornam os argumentos da função. Esses valores são atribuídos aos parâmetros nomea-
dos na definição da função. No corpo da função, uma referência a um parâmetro é avaliada com o 
valor do argumento correspondente.
